ainer\\\">\\t<div class=\\\"row custom_mc_row_question\\\">\\t\\t<b>58. </b>\\t\\tExtinction, or the disappearance of a species, is a natural occurrence. All organisms are replaced sooner or later by better adapted or newly evolved forms. However, some wild species have abruptly disappeared because humans eat or use them. The passenger pigeon and great auk were hunted to extinction during the 1800s. The buffalo was hunted almost to extinction. Today certain types of whales are more likely to become extinct unless whaling nations can agree to reduce their catch. Which of the following statements support the conclusion that wild animals that can be used by humans are more likely to face sudden extinction than other animals?\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q58\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q58[]\\\" value=\\\"1\\\">\\t\\t\\tThe passenger pigeon and great auk were hunted to extinction during the 1800s.\\t\\t</label>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q58\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q58[]\\\" value=\\\"2\\\">\\t\\t\\tExtinction is a natural occurrence.\\t\\t</label>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q58\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q58[]\\\" value=\\\"3\\\">\\t\\t\\tSpecies adapt to their environment.\\t\\t</label>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q58\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q58[]\\\" value=\\\"4\\\">\\t\\t\\tWhales are no longer hunted.\\t\\t</label>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q58\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\