lass=\'row\'>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_8\' id=\'yn1_q_8_y\' value=\'1\' />            <label for=\'yn1_q_8_y\'><img for=\'yn1_q_8_y\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/Yes.png\' width=\'70\' height=\'70\' alt=\'Yes\' /></label>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_8\' id=\'yn1_q_8_n\' value=\'2\' />            <label for=\'yn1_q_8_n\'><img for=\'yn1_q_8_n\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/No.png\' width=\'70\' height=\'70\' alt=\'No\' /></label>        </div>\"\n  },\n  {\n    \"type\": \"yes_no_question_template\",\n    \"required\": false,\n    \"label\": \"Yes No Question Template\",\n    \"name\": \"yes_no_question_template-9\",\n    \"access\": false,\n    \"value\": \"<p>I think it is more important to bring in new customers than spend time with the ones we already have. </p>        <div id=\'radio-image-selector\' class=\'row\'>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_9\' id=\'yn1_q_9_y\' value=\'1\' />            <label for=\'yn1_q_9_y\'><img for=\'yn1_q_9_y\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/Yes.png\' width=\'70\' height=\'70\' alt=\'Yes\' /></label>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_9\' id=\'yn1_q_9_n\' value=\'2\' />            <label for=\'yn1_q_9_n\'><img for=\'yn1_q_9_n\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/No.png\' width=\'70\' height=\'70\' alt=\'No\' /></label>        </div>\"\n  },\n  {\n    \"type\": \"yes_no_question_template\",\n    \"required\": false,\n    \"label\": \"Yes No Question Template\",\n    \"name\": \"yes_no_question_template-10\",\n    \"access\": false,\n    \"value\": \"<p>I use multiple channels to get my message across to customers.</p>        <div id=\'radio-image-selector\' class=\'row\'>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_10\' id=\'yn1_q_10_y\' value=\'1\' />            <label for=\'yn1_q_10_y\'><img for=\'yn1_q_10_y\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/Yes.png\' width=\'70\' height=\'70\' alt=\'Yes\' /></label>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_10\' id=\'yn1_q_10_n\' value=\'2\' />            <label for=\'yn1_q_10_n\'><img for=\'yn1_q_10_n\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/No.png\' width=\'70\' height=\'70\' alt=\'No\' /></label>        </div>\"\n  },\n  {\n    \"type\": \"yes_no_question_template\",\n    \"required\": false,\n    \"label\": \"Yes No Question Template\",\n    \"name\": \"yes_no_question_template-11\",\n    \"access\": false,\n    \"value\": \"<p>I join civic groups and clubs as a fruitful source of sales leads.</p>        <div id=\'radio-image-selector\' class=\'row\'>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_11\' id=\'yn1_q_11_y\' value=\'1\' />            <label for=\'yn1_q_11_y\'><img for=\'yn1_q_11_y\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/Yes.png\' width=\'70\' height=\'70\' alt=\'Yes\' /></label>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_11\' id=\'yn1_q_11_n\' value=\'2\' />            <label for=\'yn1_q_11_n\'><img for=\'yn1_q_11_n\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/No.png\' width=\'70\' height=\'70\' alt=\'No\' /></label>        </div>\"\n  },\n  {\n    \"type\": \"yes_no_question_template\",\n    \"required\": false,\n    \"label\": \"Yes No Question Template\",\n    \"name\": \"yes_no_question_template-12\",\n    \"access\": false,\n    \"value\": \"<p>I think many clients have unreasonable expectations.</p>        <div id=\'radio-image-selector\' class=\'row\'>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_12\' id=\'yn1_q_12_y\' value=\'1\' />            <label for=\'yn1_q_12_y\'><img for=\'yn1_q_12_y\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/Yes.png\' width=\'70\' height=\'70\' alt=\'Yes\' /></label>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_12\' id=\'yn1_q_12_n\' value=\'2\' />            <label for=\'yn1_q_12_n\'><img for=\'yn1_q_12_n\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/No.png\' width=\'70\' height=\'70\' alt=\'No\' /></label>        </div>\"\n  },\n  {\n    \"type\": \"yes_no_question_template\",\n    \"required\": false,\n    \"label\": \"Yes No Question Template\",\n    \"name\": \"yes_no_question_template-13\",\n    \"access\": false,\n    \"value\": \"<p>I find that it is often possible to satisfy a customer by explaining why he/ she is wrong.</p>        <div id=\'radio-image-selector\' class=\'row\'>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_13\' id=\'yn1_q_13_y\' value=\'1\' />            <label for=\'yn1_q_13_y\'><img for=\'yn1_q_13_y\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/Yes.png\' width=\'70\' height=\'70\' alt=\'Yes\' /></label>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_13\' id=\'yn1_q_13_n\' value=\'2\' />            <label for=\'yn1_q_13_n\'><img for=\'yn1_q_13_n\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/No.png\' width=\'70\' height=\'70\' alt=\'No\' /></label>        </div>\"\n  },\n  {\n    \"type\": \"yes_no_question_template\",\n    \"required\": false,\n    \"label\": \"Yes No Question Template\",\n    \"name\": \"yes_no_question_template-14\",\n    \"access\": false,\n    \"value\": \"<p>I find that it is important for me to be able to make a decision on the spot without having to go to my manager.</p>        <div id=\'radio-image-selector\' class=\'row\'>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_14\' id=\'yn1_q_14_y\' value=\'1\' />            <label for=\'yn1_q_14_y\'><img for=\'yn1_q_14_y\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/Yes.png\' width=\'70\' height=\'70\' alt=\'Yes\' /></label>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_14\' id=\'yn1_q_14_n\' value=\'2\' />            <label for=\'yn1_q_14_n\'><img for=\'yn1_q_14_n\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/No.png\' width=\'70\' height=\'70\' alt=\'No\' /></label>        </div>\"\n  },\n  {\n    \"type\": \"yes_no_question_template\",\n    \"required\": false,\n    \"label\": \"Yes No Question Template\",\n    \"name\": \"yes_no_question_template-15\",\n    \"access\": false,\n    \"value\": \"<p>I always ask my customers what they expect before serving them.</p>        <div id=\'radio-image-selector\' class=\'row\'>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_15\' id=\'yn1_q_15_y\' value=\'1\' />            <label for=\'yn1_q_15_y\'><img for=\'yn1_q_15_y\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/Yes.png\' width=\'70\' height=\'70\' alt=\'Yes\' /></label>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_15\' id=\'yn1_q_15_n\' value=\'2\' />            <label for=\'yn1_q_15_n\'><img for=\'yn1_q_15_n\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/No.png\' width=\'70\' height=\'70\' alt=\'No\' /></label>        </div>\"\n  },\n  {\n    \"type\": \"yes_no_question_template\",\n    \"required\": false,\n    \"label\": \"Yes No Question Template\",\n    \"name\": \"yes_no_question_template-16\",\n    \"access\": false,\n    \"value\": \"<p>I find that sometimes disagreeing with a customer leads to better results for all concerned.</p>        <div id=\'radio-image-selector\' class=\'row\'>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_16\' id=\'yn1_q_16_y\' value=\'1\' />            <label for=\'yn1_q_16_y\'><img for=\'yn1_q_16_y\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/Yes.png\' width=\'70\' height=\'70\' alt=\'Yes\' /></label>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_16\' id=\'yn1_q_16_n\' value=\'2\' />            <label for=\'yn1_q_16_n\'><img for=\'yn1_q_16_n\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/No.png\' width=\'70\' height=\'70\' alt=\'No\' /></label>        </div>\"\n  },\n  {\n    \"type\": \"yes_no_question_template\",\n    \"required\": false,\n    \"label\": \"Yes No Question Template\",\n    \"name\": \"yes_no_question_template-17\",\n    \"access\": false,\n    \"value\": \"<p>I find that most customers don&#39;t like to be asked a lot of questions.</p>        <div id=\'radio-image-selector\' class=\'row\'>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_17\' id=\'yn1_q_17_y\' value=\'1\' />            <label for=\'yn1_q_17_y\'><img for=\'yn1_q_17_y\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/Yes.png\' width=\'70\' height=\'70\' alt=\'Yes\' /></label>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_17\' id=\'yn1_q_17_n\' value=\'2\' />            <label for=\'yn1_q_17_n\'><img for=\'yn1_q_17_n\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/No.png\' width=\'70\' height=\'70\' alt=\'No\' /></label>        </div>\"\n  },\n  {\n    \"type\": \"yes_no_question_template\",\n    \"required\": false,\n    \"label\": \"Yes No Question Template\",\n    \"name\": \"yes_no_question_template-18\",\n    \"access\": false,\n    \"value\": \"<p>I find that it isn&#39;t necessary to suggest complementary services or products; customers know what they want when they call. </p>        <div id=\'radio-image-selector\' class=\'row\'>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_18\' id=\'yn1_q_18_y\' value=\'1\' />            <label for=\'yn1_q_18_y\'><img for=\'yn1_q_18_y\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/Yes.png\' width=\'70\' height=\'70\' alt=\'Yes\' /></label>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_18\' id=\'yn1_q_18_n\' value=\'2\' />            <label for=\'yn1_q_18_n\'><img for=\'yn1_q_18_n\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/No.png\' width=\'70\' height=\'70\' alt=\'No\' /></label>        </div>\"\n  },\n  {\n    \"type\": \"yes_no_question_template\",\n    \"required\": false,\n    \"label\": \"Yes No Question Template\",\n    \"name\": \"yes_no_question_template-19\",\n    \"access\": false,\n    \"value\": \"<p>I find that sometimes customers have better knowledge of the solution to a problem than I do.</p>        <div id=\'radio-image-selector\' class=\'row\'>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_19\' id=\'yn1_q_19_y\' value=\'1\' />            <label for=\'yn1_q_19_y\'><img for=\'yn1_q_19_y\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/Yes.png\' width=\'70\' height=\'70\' alt=\'Yes\' /></label>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_19\' id=\'yn1_q_19_n\' value=\'2\' />            <label for=\'yn1_q_19_n\'><img for=\'yn1_q_19_n\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/No.png\' width=\'70\' height=\'70\' alt=\'No\' /></label>        </div>\"\n  },\n  {\n    \"type\": \"yes_no_question_template\",\n    \"required\": false,\n    \"label\": \"Yes No Question Template\",\n    \"name\": \"yes_no_question_template-20\",\n    \"access\": false,\n    \"value\": \"<p>I believe that no customer is ever too chatty. I keep them talking as long as necessary.</p>        <div id=\'radio-image-selector\' class=\'row\'>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).css(\\\"border-bottom\\\", \\\"2px solid #ffc107\\\");\' type=\'radio\' name=\'yn1_q_20\' id=\'yn1_q_20_y\' value=\'1\' />            <label for=\'yn1_q_20_y\'><img for=\'yn1_q_20_y\' src=\'http://localhost/ac_site/public/img/assessments/types/yn1/Yes.png\' width=\'70\' height=\'70\' alt=\'Yes\' /></label>            <input oninvalid=\'$(this).nextAll(\\\"label\\\").eq(0).