/*!50003 CREATE DEFINER=`dataadmin`@`localhost` PROCEDURE `uppage`(
IN uname VARCHAR(255),
IN uexam VARCHAR(255),
IN cpart INT(10),
IN tempmin INT(10),
IN tempchk INT (10)
)
BEGIN
update tbstatus SET `fldpart` = cpart , `min` = tempmin , `sec` = 0 , `temp` = tempchk  where `user_id` = uname and `AssCode` = uexam;	
 END */$$
